import React from "react";

export default function Button(props) {
    return (
        <>
            <input type="submit" value={props.value} className="rounded buttonPrimary dont-extrabold decoration-[#1B48E9] hover:opacity-90 bg-white my-2 h-10" />

            <style>
                {
                    `
                        .buttonPrimary {
                            background-color: white;
                            color: #1B48E9;
                            font-weight: 800;
                            width: 320px;
                        }

                        .buttonPrimary:hover {
                            background-color: white;
                            color: #1B48E9;
                            font-weight: 800;
                            opacity: 0.9
                        }
                    `
                }
            </style>
        </>
    )
}
